			<string>set -e

PRODUCT_PATH="${SYMROOT}/Release/Analytics.framework"

## Prepare the framework Folder Structure
mkdir -p "${PRODUCT_PATH}/Versions/A/Headers"
# Link the "Current" version to "A"
/bin/ln -sfh A "${PRODUCT_PATH}/Versions/Current"
/bin/ln -sfh Versions/Current/Headers "${PRODUCT_PATH}/Headers"
/bin/ln -sfh Versions/Current/Analytics "${PRODUCT_PATH}/Analytics"

## Compile for both iPhone (armv7, armv7s) and iPhone Simulator (i386)
xcodebuild -workspace Analytics.xcworkspace -scheme Analytics -configuration Release -sdk iphonesimulator
xcodebuild -workspace Analytics.xcworkspace -scheme Analytics -configuration Release -sdk iphoneos

## Combine the two separate libAnalytics.a into a single fat binary containing all 3 architectures
lipo -output "${SYMROOT}/Release/libAnalytics.a" -create \
    "${SYMROOT}/Release-iphoneos/libAnalytics.a" \
    "${SYMROOT}/Release-iphonesimulator/libAnalytics.a"

## Strip out Pods-dummy objects to prevent duplicate symbol when used by CocoaPods
for ARCH in i386 armv7 armv7s
do
    lipo "${SYMROOT}/Release/libAnalytics.a" -thin $ARCH -output "${SYMROOT}/Release/libAnalytics-${ARCH}-clean.a"
    DUMMY_OBJECTS=`ar -t ${SYMROOT}/Release/libAnalytics-${ARCH}-clean.a | grep ^Pods.*-dummy.o$ | tr '\n' ' '`
    ar -sd "${SYMROOT}/Release/libAnalytics-${ARCH}-clean.a" $DUMMY_OBJECTS
done

## Create a fat lib from the now cleaned up thin libs and place inside framework
lipo -output "${PRODUCT_PATH}/Versions/A/Analytics" -create \
    "${SYMROOT}/Release/libAnalytics-i386-clean.a" \
    "${SYMROOT}/Release/libAnalytics-armv7-clean.a" \
    "${SYMROOT}/Release/libAnalytics-armv7s-clean.a"

## Copy headers into the framework
# The -a ensures that the headers maintain the source modification date so that we don't constantly
# cause propagating rebuilds of files that import these headers.
/bin/cp -a "${SYMROOT}/Release-iphoneos/AnalyticsHeaders/" "${PRODUCT_PATH}/Versions/A/Headers/"

# Zip up the framework and license for distribution, and open products folder
cd "${SYMROOT}/Release"
cp "${PROJECT_DIR}/License.md" .
zip --symlinks -r Analytics-${ANALYTICS_VERSION}.zip Analytics.framework License.md
open .
